                        <p className="main-landing-text">Знаходьте <span className="main-text-gradient">молоді таланти</span> легко</p>
                    </div>
                    <div className="landing-employer-main-button">
                        <button className="employer-landing-button">Розмістити вакансію</button>
                    </div>
                </div>
            </div>
        </div>

    )
}
